import { Container } from '@mui/system'
import React from 'react'
import { Navbar } from 'react-bootstrap'
import Box from '@mui/material/Box';
import IconButton from '@mui/material/IconButton';

const Rechercheeheader = () => {
  return (
    <Navbar style={{backgroundColor:"red",display:'flex',justifyContent:'center',marginBottom:'52vh',height:'100px',marginRight:'20px',width:'145vh'}}>
        <Container>

            <h1>recherche</h1>








            <Box sx={{
                    display: { sm: 'none' },
                    '& .MuiIconButton-root': {
                      color: '#9A0680',fontFamily:'Ink Free' 
                    },
                    textShadow: '0px 0px 5px #b393d3, 0px 0px 10px #b393d3, 0px 0px 10px #b393d3, 0px 0px 20px #b393d3'
                                  }}>
                <IconButton
                  aria-label="open drawer"
                  edge="end"
                  onClick={handleDrawerToggle}
                >
                  <MenuIcon />
                </IconButton>
              </Box>
        </Container>
      
    </Navbar>







  )
}

export default Rechercheeheader
